/*
快手极速版-接口版

签到和翻倍，开宝箱和翻倍，看广告，逛街，直播，小说视频奖励
金币每天0点自动兑换到现金余额
捉api_client_salt需要能捉包的安卓机或9.1.11及以下的IOS版本

可以把自己完整的url填在对应cookie后面，会自动匹配到脚本中
格式为 ksjsbUrl=xxxxxxx;
注意最后的分号是必须要的

变量：
ksjsbCookie：必填，账号ck。egid和did_gt不填的话会随机一个。多账号用换行隔开。格式 export ksjsbCookie="kuaishou.api_st=xxxxx; did=aaaaaaaa; kuaishou.api_client_salt=bbbbbbbb; ksjsbUrl=xxxxxxx;"
ksjsbCash：选填，固定提现额度，默认为空，即按照列表[50,20,10,3]提现
withdrawTime：选填，提现时间，默认为早10点。可自定义小时，多个时间用逗号隔开，如： export ksjsbWithdrawTime="8,19"
ksjsbNotify：选填，推送开关。0：不通知，1：提现时间通知，2：每次运行通知。默认为1
ksjsbDelayTime：选填，自定义延迟，默认为1500，即每次看完广告休息1500毫秒(1.5秒)
ksjsbOpenBox：选填，开宝箱开关，默认为0，即不开宝箱。想自动开的话，设置变量为1
ksjsbOtherTask：选填，逛街直播等其他任务开关，默认为0，即不做。想自动做的话，设置变量为1

支持自己搭建的sig3接口
sigurl：sig3接口url，要求为get请求，直接返回sig3，脚本会把[url+sig]放在请求参数里。如果有token验证，请把token也写在变量sigurl里
格式如： export sigurl='http://192.168.0.2:6789/?token=你的token&str='

定时一天5次以上

重写：
[task_local]
#快手极速版
38 7-18 * * * https://raw.githubusercontent.com/leafTheFish/DeathNote/main/ksjsb_v2.js, tag=快手极速版, enabled=true
[rewrite_local]
appsupport/yoda/biz/info url script-request-header https://raw.githubusercontent.com/leafTheFish/DeathNote/main/ksjsb_v2.js
ksapp/client/package/renew url script-request-header https://raw.githubusercontent.com/leafTheFish/DeathNote/main/ksjsb_v2.js
[MITM]
#IOS用第一个，安卓用第二个
hostname = api.kuaisho*.com
hostname = open.kuaisho*.com

const $ = new Env("快手极速版-接口版")
*/
